('2095','15','7734','Landhaus Binibona Bertorelli',Null,'Schönes Landhaus in der Sierra de Tramuntana ','27348','Inmitten der wild romantischen Gebirgslandschaft der Sierra de Tramuntana, in einem kleinen, friedlichen Dörfchen erwartet Sie ein beschauliches Landhaus in perfektem Zustand. Das Haus bietet sieben große, schön eingerichtete  Schlafzimmer, die alle über Bädern en suite verfügen. Zur Ausstattung gehören Klimaanlage, Zentralheizung und Satellitenfernsehen.\r\nDie Immobilie wurde geschmackvoll im landestypischen Stil eingerichtet, der den Charme des alten Spaniens widerspiegelt.  \r\nDas ursprüngliche Gebäude, mit zwei maurischen Türmen, wurde von einheimischen Handwerkern umsichtig renoviert, sodass nichts vom traditionellen Charakter verloren ging und gleichzeitig jeder moderne Komfort geboten wird. \r\nZum Anwesen gehört außerdem noch eine großzügige Wohnung mit Wohnzimmer, zwei Schlafzimmern und Badezimmer. Eingebettet im mediterran angelegten Garten liegt ein Pool mit Liegeterrassen.\r\nDas Anwesen wurde bisher als Landhotel genutzt.','27349','2000000','111','2013-08-28 14:55:02','110','2013-08-28 14:55:30',Null,'1967','123','651',1,'1','0',Null,Null,Null,'27350',Null,'0','0','0',Null,'2016-01-26 14:55:38',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'27351',Null,'27352',Null,'27353',Null,'27354',Null,'27355','0',0,'0');
